import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

function Navbar() {

  const { user, logout, isAuthenticated } = useAuth();

  if (isAuthenticated && user?.username) return (
    <nav className="bg-gray-800 py-2 sm:py-2.5 fixed w-full z-10">
      <ul className="flex list-none p-0 m-0 justify-center">
        <li className="mx-1 sm:mx-2.5">
          <Link to="/favorites" className="text-white no-underline px-1.5 py-1 sm:px-2.5 sm:py-1.5 rounded transition-colors duration-300 hover:bg-gray-600 text-sm sm:text-base">Favorites</Link>
        </li>
        <li className="mx-1 sm:mx-2.5">
          <Link to="/all" className="text-white no-underline px-1.5 py-1 sm:px-2.5 sm:py-1.5 rounded transition-colors duration-300 hover:bg-gray-600 text-sm sm:text-base">All</Link>
        </li>
        <li className="mx-1 sm:mx-2.5">
          <Link to="/friends" className="text-white no-underline px-1.5 py-1 sm:px-2.5 sm:py-1.5 rounded transition-colors duration-300 hover:bg-gray-600 text-sm sm:text-base">Friends</Link>
        </li>
        <li className="mx-1 sm:mx-2.5">
          <a onClick={logout} className="text-white no-underline px-1.5 py-1 sm:px-2.5 sm:py-1.5 rounded transition-colors duration-300 hover:bg-gray-600 cursor-pointer text-sm sm:text-base">Log Out</a>
        </li>
      </ul>
    </nav>
  )
  else return (
    <nav className="bg-gray-800 py-2 sm:py-2.5 fixed w-full z-10 text-center">
      <Link to="/login" className="text-white no-underline px-2.5 py-1.5 rounded transition-colors duration-300 hover:bg-gray-600 text-sm sm:text-base">Log In</Link>
    </nav>
  );
}

export default Navbar;
